import './App.css';
import React, { useState } from "react";

function App() {

    const [change, setChange] = useState(true);

    return (
        <>
            <div className="App">
                <header className="header">CONNECT 4 GAME</header>

                <button className="bu" onClick={() => setChange(!change)}>
                    {
                        change?
                            <button className="bu-pressed-yellow"/>
                            :null
                    }
                </button>
            </div>
        </>
    )
}

export default App;
